The following JavaScript example shows how to call Get and return a list of Devices. Note that it returns only the first 10 and the devices have to be active.

 api.call("Get",{"typeName":"Device",
   "resultsLimit":10,
   "search":{
   "fromDate":new Date().toISOString()
}});

The following JavaScript example shows how to get amount of entities of the given type (in this case Zones).

api.call("GetCountOf",{
   "typeName": "Zone"
});

The following JavaScript example shows how to call GetFeed and return a list of Trips. Note that it returns only the first 10 trips and after that another 10.

var feed = (function(){
var version = "0000000000000000";
return {
    next: function(success){
        api.call("GetFeed", {
            "typeName":"Trip",
                "resultsLimit": 10,
                "fromVersion": version,
                "search": {
                toDate: (new Date()).toISOString(),
                fromDate: (new Date((new Date()).getTime() - (7 * 24 * 60 * 60 * 1000))).toISOString()
            }
        }, function(result){
            version = result.toVersion;
            success(result.data);
        });
    },
    reset: function(){
        version = "0000000000000000";
    }
};
})();

feed.next(function(trips){
    console.log("First part: ", trips);
    feed.next(function(trips){
        console.log("Second part: ", trips);
    });
});

The following JavaScript example shows how to remove a zone.

 var zoneName = prompt("Enter the name of zone that you want to remove");
   api.call("Get", {
       "typeName": "Zone",
       "search": {
            name: "%" + zoneName + "%"
        }
   }, function(zones){
        if (zones.length) {
            api.call("Remove", {
                "typeName": "Zone",
                "entity": { "id": zones[0].id }
            });
        } else {
            console.log("There is no zone with such name");
        }
   });

The following JavaScript example shows how to change entities (for example zone's name).

 var zoneName = prompt("Enter current zone name"),
   newZoneName = prompt("Enter new zone name");
   api.call("Get", {
       "typeName": "Zone",
       "search": {
            name: "%" + zoneName + "%"
        }
   }, function(zones){
        var zone = zones[0];
        if (zone) {
            zone.name = newZoneName;
            api.call("Set", {
                "typeName": "Zone",
                "entity": zone
            });
        } else {
            console.log("There is no zone with such name");
        }
   });

