The following JavaScript example shows how to get maximum speed limits.

var deviceName = prompt("Enter device name");
api.call("Get", {
    "typeName": "Device",
    "search": {
       name: "%" + deviceName + "%"
    }
}, function(devices) {
   if (devices.length){
        api.call("GetRoadMaxSpeeds", {
           "deviceSearch": {
                id: devices[0].id
            },
           "fromDate": (new Date((new Date()).getTime() - (7 * 24 * 60 * 60 * 1000))).toISOString(),
           "toDate": (new Date()).toISOString()
        });
    } else {
        console.log("There are no devices with such name");
    }
});

The following JavaScript example shows how to get daylight saving rules for the given time zone.

api.call("GetDaylightSavingRules", {
   "timeZoneId": "America/Toronto"
});

The following JavaScript example shows how to generate a new CAPTCHA.

var generateGUID = function(){
    return 'xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx'.replace(/[xy]/g, function(c) {
        var r = Math.random() * 16 | 0, v = c == 'x' ? r : (r & 0x3 | 0x8);
        return v.toString(16);
    });
};

var captcha = new Image();
captcha.src = "/apiv1/GenerateCaptcha?id=" + generateGUID();
document.body.appendChild(captcha);
